description:
Rob a series of banks at the speed of light ? It's possible with a jetpack ! But not just any jetpack. For a device built in the 1950's, billy's jetpack is a real technology jewel ! 

A turbo button allows him to pass through armoured windows and move in between security guards trained in the dreaded art of kung fu !

